export interface InstagramUser {
    id: string;
    category: string;
    fullName: string;
    bio: string;
    website: string;
    followersCount: number;
    followingsCount: number;
    isPrivate: boolean;
    isVerified: boolean;
    avatar: string;
    fbPage: string;
    postsCount: number;
    posts: InstagramPost[];
}
export interface InstagramPost {
    id: string;
    shortcode: string;
    photo: string;
    isVideo: boolean;
    description: string;
    commentsCount: number;
    likesCount: number;
    time: number;
    location: string;
}
